// App.js
import React from 'react';
import './App.css';
import RealEstatePricePredictor from './components/RealEstatePricePredictor';

const App = () => {
    return (
        <div className="App">
            <h1>Real Estate Price Predictor</h1>
            <RealEstatePricePredictor />
        </div>
    );
};

export default App;
